import React, { useState, useEffect } from "react";

const VennData = ({ onDataLoaded }) => {
  const [vennData, setVennData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch("./venn_out_data (1).txt");
        if (!response.ok) {
          throw new Error("Failed to fetch data");
        }
        const text = await response.text();
        const rows = text.trim().split("\n");
        const headers = rows.shift().split("\t"); // Assuming headers are in the first row
        const data = rows.map((row) => {
          const values = row.split("\t");
          return headers.reduce((obj, header, index) => {
            obj[header] = values[index];
            return obj;
          }, {});
        });
        setVennData(data);
        onDataLoaded(data); // Pass data to parent component
      } catch (error) {
        console.error("Error fetching the Venn diagram data:", error);
      }
    };

    fetchData();
  }, [onDataLoaded]);

  return (
    <div>
      <h2>Venn Diagram Data</h2>
      <table>
        <thead>
          <tr>
            {vennData.length > 0 &&
              Object.keys(vennData[0]).map((header) => (
                <th key={header}>{header}</th>
              ))}
          </tr>
        </thead>
        <tbody>
          {vennData.map((row, index) => (
            <tr key={index}>
              {Object.values(row).map((value, index) => (
                <td key={index}>{value}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default VennData;
